package com.twjitm.transaction.transaction.enums;/** * 事物锁类型 * * @author twjitm - [Created on 2018-08-27 11:50] * @company https://github.com/twjitm * @jdk java version "1.8.0_77" */public enum  NettyTransactionLockType {    /**独自占有锁 */    WRITE,    /**读锁*/    READ,    /** 独自写占有，到时间才会释放锁*/    WRITE_TIME,    /** 独自写占有，无论获取锁成功，强制时间锁， 到时间时间释放*/    FORCE_WRITE_TIME,    ;}